	bSync.init({
		notify: true,
		server: {
			baseDir: "dist",
		},
		port: 8000
	})

	watch([
		"src/js/*.js"
	], series(jsTask));

	watch([
		"src/**/**.pug"
	], series(pugTask));

	watch([
		"src/components/**/**.sass"
	], series(sassTask));

	watch([
		"src/img/**/**.{svg,png,jpg,speg,gif}"
	], series(cleanImage, copyImage));

	watch([
		"src/_plugins/**/**.css", "src/_plugins/**/**.js", "config.json"
	], parallel(jsCore, cssCore));

	watch([
		"dist"
	]).on("change", bSync.reload);
}

module.exports = server;

